INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(1, 'Видеокарта Palit GeForce RTX 3070 Ti GamingPro', 'Видеокарта Palit GeForce RTX 3070 Ti GamingPro, собранная специально для геймеров-энтузиастов, способна обескуражить потрясающей графикой и частотой кадров. Благодаря видеопроцессору GeForce RTX 3070 Ti и 8 ГБ памяти она может ускорять даже искусственный интеллект, задействованный при воспроизведении игр и при работе с графикой! Чтобы даже при максимальных нагрузках устройство не перегревалось, оно было оснащено кулерами TurboFan 3.0 и алюминиевыми пластинами.\r\nВ корпусе видеокарты Palit GeForce RTX 3070 Ti GamingPro сочетаются черный и серебристый цвета, а также встроенная ARGB-подсветка с возможностью настройки каждого элемента.', , 'image/jpeg', 57999, 'videocards', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(2, 'Видеокарта Sapphire AMD Radeon R7 240', 'Видеокарта Sapphire AMD Radeon R7 240 является оптимальной по возможностям моделью для домашнего компьютера с определенной игровой направленностью. Этот компактный и малошумный видеопроцессор получил поддержку важных для обработки графики стандартов DirectX 11.1 и OpenGL 4.5. При установке в системном блоке он займет один порт PCI-E 3.0 и потребует БП с мощностью минимум 400 Вт при собственном часовом расходе энергии всего 75 Вт.', , 'image/jpeg', 6899, 'videocards', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(3, 'Процессор Intel Core i5-11400F OEM', 'Процессор Intel Core i5-11400F OEM сочетает в себе высокую производительность и эффективность, благодаря чему эта модель отличается универсальностью и может использоваться для мощных игровых систем и рабочих станций. Процессор выполнен на базе Rocket Lake-S и техпроцесса 14 нм, за счет чего отличается технологичностью. Помимо этого, благодаря особой конструкции и сокету LGA 1200 модуль отличается простой установкой.\r\nВычислительная мощность Intel Core i5-11400F OEM обеспечивается за счет 6 ядер и 12 потоков, которые поддерживают широкий диапазон рабочих частот, а также встроенной графикой и поддержкой до 128 ГБ временной памяти. За счет этого, а также массивных кэшей на разных уровнях модель может обеспечить высокий уровень быстродействия для эффективного решения самых разных задач.\r\nДругой особенностью процессора является сравнительно низкое тепловыделение, не превышающее 65 Вт. Благодаря этой особенности модель может использоваться для сборок в корпусах с ограниченным внутренним пространством.', , 'image/jpeg', 10499, 'processors', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(4, 'Процессор AMD Ryzen 5 5600X BOX', 'Процессор AMD Ryzen 5 5600X BOX – это мощное решение для игровых систем и рабочих станций. В основе модели используются высококачественные компоненты и передовые технологии, что в связке с большим числом физических ядер и виртуальных потоков может обеспечить непревзойденно высокую вычислительную мощность в любых сценариях использования компьютера.\r\nПоддерживаемые AMD Ryzen 5 5600X частоты могут варьироваться от 3.7 до 4.6 ГГц. Благодаря этому, а также свободному множителю данная модель отличается высоким уровнем быстродействия и большим потенциалом для его дальнейшего развития.\r\nОбъем поддерживаемой временной памяти может достигать 128 ГБ. Также вычислительный модуль поддерживает работу с интерфейсом PCI-E 4 поколения, что открывает широкие возможности для создания бескомпромиссной компьютерной системы для работы и развлечений.\r\nПомимо высокой производительности процессор также отличается малым тепловыделением, которое не превышает 65 Вт. Для охлаждения могут использоваться как воздушные, так и водяные системы. Установка на материнскую плату производится при помощи сокета AM4.', , 'image/jpeg', 14299, 'processors', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(5, 'Оперативная память Kingston FURY Beast Black 16ГБ', 'Оперативная память Kingston FURY Beast Black способна обеспечить высокие показатели производительности и скорости в составе игрового компьютера. Два модуля DDR4 объемом по 8 ГБ и частотой в пределах 3200 МГц помогают ускорить запуск компьютерных игр, повысить отзывчивость системы при редактировании видео и визуализации. Kingston FURY Beast выделяется стилизованным алюминиевым радиатором черного цвета. Конструкция с ребристой верхней панелью способствует эффективному отведению тепла и помогает исключить перегрев чипов при продолжительных нагрузках. Оперативная память отличается совместимостью с платформами производителей Intel и AMD.', , 'image/jpeg', 4499, 'ram', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(6, 'Оперативная память Kingston FURY Beast Black RGB 64ГБ', 'Оперативная память Kingston FURY Beast Black RGB стандарта DDR5 привлекает внимание геймеров стильным оформлением и позволяет осуществлять разгон игрового ПК. Быстродействие в играх с высокими графическими настройками, во время прямых трансляций с разрешением 4K+, при создании контента и 3D-рендеринге достигается благодаря двум модулям объемом по 32 ГБ с частотой в пределах 5600 МГц. Профили Intel XMP 3.0/AMD EXPO обеспечивают быстрый и стабильный разгон.\r\nАлюминиевый радиатор стабильно охлаждает чипы памяти. Яркая подсветка RGB предоставляет возможность настройки с помощью ПО Kingston FURY CTRL и поддерживает синхронизацию Infrared Sync. Функция определения и исправления ошибок ODECC помогает сохранять целостность данных. На плате расположена микросхема управления питанием (PMIC), которая регулирует мощность и гарантирует тем самым стабильность работы Kingston FURY Beast Black RGB.', , 'image/jpeg', 26799, 'ram', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(7, 'Блок питания DEEPCOOL DQ750', 'Соответствующий форм-фактору ATX блок питания Deepcool DQ750 совместим с тотальным большинством корпусов. Номинальная мощность модели равна 750 Вт. Это высокий показатель. Блок питания без каких-либо сложностей обеспечит функционирование системного блока, насыщенного комплектующими, потребляемая мощность которых очень высока. Модель оптимальна для монтажа в компьютеры, предназначенные для игр или для решения серьезных профессиональных задач. Надежность и высокую эффективность блока питания помогают гарантировать японские конденсаторы.\r\nБлок питания Deepcool DQ750 располагает модульной системой кабелей. В наличии 8 разъемов 15-pin SATA и 4 разъема Molex. Отдельного внимания заслуживает значительная (730 мм) длина кабеля процессора.\r\nОхлаждение блока питания осуществляет 120-миллиметровый вентилятор. Помимо модульных кабелей, в комплект входят сетевой кабель, крепежные винты и документация. Размеры блока питания – 160x150x86 мм. Масса модели составляет 1508 г. Цвет корпуса – черный.', , 'image/webp', 8299, 'power_supplies', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(8, 'Блок питания DEEPCOOL', 'Блок питания Deepcool DQ ST 750W выполнен из черного качественного металла, его величина стандартна и способна поместиться в любой компьютер.\r\nDeepcool DQ ST 750W может стать сердцем для компьютера – как для рабочей \"лошадки\", так и для игрового \"мустанга\". Сертификация по эффектинвости потребления энергии 80 PLUS Gold, которую прошел этот блок питания, показывает замечательные характеристики КПД, то есть соотношение потребляемой энергии ее производственным мощностям.\r\nАктивное охлаждение осуществляется посредством мощного вентилятора, который работает бесшумно, что необычно для бп такой мощности. Конструкция кулера разработана таким образом, чтобы при премиальном отведении тепла обеспечивать низкий уровень шума, практически незаметный для человеческого слуха.', , 'image/webp', 7299, 'power_supplies', ''),
(9, 'Система охлаждения MSI MEG CORE LIQUID S360', 'Жидкостная система охлаждения MSI MEG CORELIQUID S360 подходит для охлаждения высокопроизводительного процессора, в том числе – используемого в составе игрового компьютера высокого класса. Устройство совместимо с подавляющим большинством распространенных в настоящее время сокетов. СЖО оснащена крупным, но легким радиатором, произведенным с использованием высококачественного алюминия. Материал водоблока – медь. Главная особенность модели – наличие дисплея, на который выводится информация о температуре процессора.\r\nСистема охлаждения MSI MEG CORELIQUID S360 оборудована тремя 120-миллиметровыми вентиляторами, которые могут останавливаться. Максимальная частота вращения вентиляторов высока – 2000 оборотов в минуту. Регулировка скорости вращения осуществляется в автоматическом режиме. При максимальной скорости каждый из вентиляторов генерирует воздушный поток 56.2 CFM. Уровень шума при этом невысок – 22.7 дБ. Система является необслуживаемой. Это означает, что замена компонентов и хладагента не осуществляется.', , 'image/webp', 29699, 'cooling', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(10, 'Система охлаждения DEEPCOOL LS720', 'СЖО DeepCool LS720 премиум-класса для процессора обеспечивает максимальную эффективность охлаждения и низкий уровень шума благодаря 360-мм радиатору и трем вентиляторам FC120 A-RGB PWM.', , 'image/webp', 11990, 'cooling', ''),
(11, 'Радиочастотная гарнитура Logitech G435 LIGHTSPEED синий', 'адиочастотная гарнитура Logitech G435 LIGHTSPEED невероятно эффектна: дизайн устройства оформлен с помощью оригинального сочетания синего, розового и фиолетового цветов. Модель, соответствующая аудиоформату 2.0, оптимизирована для использования в играх. Возможные способы беспроводного соединения – Bluetooth и радиоканал. Устройство совместимо с консолями PS5. Максимальное расстояние подключения гарнитуры составляет 10 м.\r\nРадиочастотная гарнитура Logitech G435 LIGHTSPEED очень комфортна. Удобство использования устройства гарантируют мягкие амбушюры и регулируемое оголовье. Модель имеет закрытое акустическое оформление. Устройство ограждает слух пользователя от шума внешнего мира. Ничто не помешает вам полностью сосредоточиться на сражениях с виртуальными и реальными противниками. Воспроизведение осуществляется в широком частотном диапазоне – от 20 Гц до 20 кГц. Микрофон, встроенный в корпус гарнитуры, гарантирует точную передачу голоса любой громкости. Максимальное время работы устройства без подзарядки аккумулятора составляет 18 ч.', , 'image/webp', 7590, 'headset', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(12, 'Bluetooth-гарнитура Razer Kraken Hello Kitty розовый', 'Bluetooth-гарнитура Razer Kraken Hello Kitty обеспечивает качественное и чистое звучание в оптимальном для восприятия диапазоне от 20 до 20000 Гц. Наушники закрытого типа имеют удобную посадку и оформлены в розовом цвете в кошачьем стиле. Модель поддерживает технологию 7.1 Virtual, что создает эффект полного присутствия в играх. Бесперебойное подключение к устройству осуществляется через Bluetooth версии 5.0. Настройками можно управлять со смартфона с помощью специального приложения.\r\nBluetooth-гарнитура Razer Kraken Hello Kitty способна работать до 50 ч без подзарядки. Мягкие амбушюры снижают давление на голову и обеспечивают удобную посадку. Динамики диаметром 40 мм обеспечивают глубокий и чистый звук на всех уровнях частотах. В корпусе предусмотрен двойной всенаправленный микрофон с шумоподавлением, благодаря чему голос передается без искажений.', , 'image/webp', 10990, 'headset', ''),
(13, '500 ГБ 2.5\" SATA накопитель Samsung 870 EVO', 'SATA накопитель Samsung 870 EVO объемом 500 ГБ – вместительное и надежное устройство хранения с высокой производительностью. Он оснащен быстрым контроллером и флэш-памятью 3D NAND. Накопитель помогает повысить отзывчивость системы при обработке данных. В режиме последовательного чтения скорость достигает 560 Мбайт/с, что способствует более быстрой загрузке данных в процессе выполнения задач на ПК. Благодаря форм-фактору 2.5 дюйма накопитель подходит для установки в настольные и портативные компьютеры. Из преимуществ Samsung 870 EVO – аппаратное шифрование данных.', , 'image/webp', 5590, 'memory', ''),
(14, '2000 ГБ 2.5\" SATA накопитель Samsung 870 QVO', 'SATA накопитель Samsung 870 QVO обеспечивает повышение производительности в играх и ресурсоемких приложениях. Интерфейс SATA III и технология 3D NAND QLC помогают добиться скорости на уровне показателя 560 Мбайт/сек в режиме чтения. Увеличенный объем 2000 ГБ предоставляет достаточно большое пространство для хранения игр, мультимедийных файлов и прочего контента. Фирменное ПО Samsung Magician позволяет выполнять мониторинг системы и управлять различными настройками накопителя в режиме реального времени. Прочная конструкция и увеличенный рабочий ресурс гарантируют стабильность Samsung 870 QVO.', , 'image/webp', 15990, 'memory', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(15, 'Корпус ZET GAMING Rare M2 ARGB черный', 'Корпус ZET GAMING Rare M2 ARGB обращает на себя внимание эффектной многоцветной подсветкой вентиляторов. Модель, соответствующая типоразмеру Midi-Tower, обладает совместимостью с материнскими платами E-ATX, Micro-ATX, Mini-ITX и Standard-ATX. Корпус подходит для сборки высокопроизводительного ПК, в том числе – игрового. Любители видеоигр оценят возможность установки видеоадаптера (или нескольких видеоадаптеров) с длиной до 38 см. Максимально возможная высота кулера процессора равна 165 мм.\r\nКорпус ZET GAMING Rare M2 ARGB оборудован четырьмя 120-миллиметровыми вентиляторами, скорость вращения которых регулируется с помощью встроенного блока управления. Эффективность теплообмена помогает обеспечить перфорация передней и верхней панелей. В наличии боковое окно, выполненное из закаленного стекла. Толщина стали, использованной в процессе производства корпуса, равна 0.7 мм. В комплекте – документация, набор крепежа и спикер. Корпус имеет габаритные размеры 447x220x510 мм и массу 6.7 кг. Цвет модели классический – черный.', , 'image/webp', 6790, 'body', '');
INSERT INTO `Products` (`id`, `Name_tovar`, `Opisanie`, `IMG`, `IMG_type`, `Price`, `Categori`, `href`) VALUES
(16, 'Корпус ZALMAN Z-Machine 500 черный', 'Корпус ZALMAN Z-Machine 500 только недавно появился на рынке компьютерной техники, однако уже сейчас можно сказать, что это достойный представитель компании Zalman. Габариты корпуса позволяют устанавливать платы в формате формата E-ATX, ATX, Micro-ATX и Mini ITX, и к тому же вы сможете разместить здесь до 7 карт расширения, а также несколько накопителей – их количество будет зависеть от размеров.', , 'image/webp', 53990, 'body', ''),
(17, 'Мышь беспроводная Logitech PRO X SUPERLIGHT черный', 'Мышь беспроводная Logitech PRO X SUPERLIGHT – игровая модель, отличающаяся значительным (25600 dpi) разрешением оптического светодиодного сенсора. Высочайшая точность позиционирования курсора, обеспечиваемая датчиком HERO 25K, помогает эффективно противодействовать виртуальным и реальным противникам в динамичных видеоиграх. Преимуществом модели также является способность выдерживать существенное (до 40 G) ускорение.\r\nМышь беспроводная Logitech PRO X SUPERLIGHT оснащена 5 кнопками. Устройство располагает встроенной памятью, необходимой для сохранения настроек. Манипулятор подключается к компьютеру с использованием помехоустойчивого радиоканала. Миниатюрный ресивер устанавливается в порт USB типа A. Источник питания мыши – встроенный аккумулятор. Устройство рассчитано на автономную работу в течение времени, достигающего 70 ч.\r\nСимметричность корпуса мыши делает удобным хват как правой, так и левой рукой. Устройство очень легкое: его масса равна лишь 63 г. Преимуществом мыши также является компактность. Размеры манипулятора составляют 63.5x40x125 мм.', , 'image/webp', 12490, 'other', ''),
(18, 'Мышь беспроводная/проводная Razer DeathAdder V2 Pro черный', 'Мышь беспроводная/проводная Razer DeathAdder V2 Pro может «похвастаться» наличием программируемых клавиш, нажатие на которые мгновенно выполнит необходимую команду. Этот аксессуар подключается к ПК или ноутбуку посредством 1.8-метрового кабеля, а также функционирует от ресурса встроенного аккумулятора. Несомненным плюсом мыши является совместимость с Xbox One, а также возможность установки точных параметров с использованием Razer Synapse 3.\r\nИспользуя колесико прокрутки Razer DeathAdder V2 Pro, не составит труда мгновенно просмотреть различные страницы во Всемирной паутине. Корпус аксессуара выполнен с использованием тефлона, пластика и резины – износоустойчивых материалов, поверхность которых не подвержена преждевременному появлению повреждений. В основу мыши положен сенсор Razer Focus+, гарантирующий непревзойденную четкость при наведении курсора.', , 'image/webp', 7790, 'other', '');

